import React from "react";

const Count = props => {
  // deconstr props
  const { increment, decrement, value } = props;
  return (
    <div>
      <h1>Value: {value}</h1>
      <button onClick={increment}>increment</button>
      <button onClick={decrement}>decrement</button>
      <button>Reset State</button>
    </div>
  );
};

export default Count;
